version: "1"
package:
  id: com.netease.youdaonote.linyaps
  kind: app
  name: Youdao Note
  version: 8.0.102.1
  description: convert from 8.0.102    The Youdao Note

base: org.deepin.base/23.1.0.3
runtime: org.deepin.runtime.dtk/23.1.0.0

build: |
  echo Package: ynote-desktop > $PREFIX/packages.list
  bash ./install_dep linglong/sources $PREFIX

  mkdir build || true
  cd build
  ar -x ../linglong/sources/ynote-desktop.deb data.tar.xz
  tar -xvf data.tar.xz
  mv opt/有道云笔记 opt/ynote
  cp -r opt/ynote $PREFIX
  cp -rP usr/* $PREFIX
  # 软件包deskopt的Exec和Icon需要改成支持玲珑的方式
  cp ../ynote-desktop.desktop $PREFIX/share/applications

command:
  - /opt/apps/com.netease.youdaonote.linyaps/files/ynote/ynote-desktop

